import React, { Component } from "react";
import TopBar from "../Menu/MenuPage/TopBar";

class Checkout extends Component {
  render() {
    return (
      <div>
        <TopBar />
        <h1>Thank you!</h1>
        <h4>
          We have sent you a text message to confirm that you will pick up your
          order. Please reply "CONFIRM" to your text message so that we can
          start preparing your order. We'll see you soon!
        </h4>
      </div>
    );
  }
}

export default Checkout;
